problem_text:
Перед волейбольным турниром измерили рост игроков волейбольной команды города N. Оказалось, что рост каждого из волейболистов этой команды больше 190 см и меньше 210 см. Выберите утверждения, которые верны при указанных условиях.

\begin{center}
\begin{tabularx}{\textwidth}{p{0.1cm}X} 
1) & В волейбольной команде города N обязательно есть игрок, рост которого равен 220 см. \\ 
2) & В волейбольной команде города N нет игроков с ростом 189 см. \\ 
3) & Рост любого волейболиста этой команды меньше 210 см. \\ 
4) & Разница в росте любых двух игроков волейбольной команды города N составляет более 20 см. \\ 
\end{tabularx}
\end{center}

В ответе запишите номера выбранных утверждений без пробелов, запятых и других дополнительных символов.

translation:
Before the volleyball tournament, they measured the height of the players of the volleyball team of city N. It turned out that the height of each of the volleyball players on this team is more than 190 cm and less than 210 cm. Select the statements that are true under the given conditions.

\begin{center}
\begin{tabularx}{\textwidth}{p{0.1cm}X} 
1) & In the volleyball team of city N, there is definitely a player whose height is 220 cm. \\ 
2) & In the volleyball team of city N, there are no players with a height of 189 cm. \\ 
3) & The height of any volleyball player on this team is less than 210 cm. \\ 
4) & The height difference between any two players on the volleyball team of city N is more than 20 cm. \\ 
\end{tabularx}
\end{center}

In your response, write down the numbers of the selected statements without spaces, commas, and other additional characters.

