problem_text:
Найдите трёхзначное число $A$, обладающее тремя свойствами: 

\begin{itemize}
\item сумма цифр числа $A$ делится на 6;
\item сумма цифр числа $A+3$ делится на 6;
\item число $A$ больше 350 и меньше 400. 
\end{itemize}

В ответе укажите какое-нибудь одно такое число.

translation:
Find a three-digit number $A$ that has three properties:

\begin{itemize}
\item the sum of the digits of the number $A$ is divisible by 6;
\item the sum of the digits of the number $A+3$ is divisible by 6;
\item the number $A$ is greater than 350 and less than 400.
\end{itemize}

In your answer, indicate any one such number.

solution:
To find the area of the parallelogram, we can decompose it into two congruent triangles. Let $E$ be the midpoint of $AD$. 

[asy]
pair A,B,C,D,E;
A=(0,0);
B=(6,0);
C=(10,4);
D=(4,4);
E=(2,2);
draw(A--B--C--D--cycle);
draw(A--C);
draw(B--D);
draw(A--E--D);
label("$A$",A,SW);
label("$B$",B,SE);
label("$C$",C,NE);
label("$D$",D,NW);
label("$E$",E,NE);
label("$6$",(A+B)/2,S);
label("$10$",(A+C)/2,NW);
label("$10$",(B+D)/2,SE);
[/asy]

Since $AE=ED$ and $AC=BD$, we have $\triangle ACE \cong \triangle BDE$ by the Side-Angle-Side congruence. 

Now, we can find the area of one of the triangles. The base is $AE=ED=4$ and the height is $AC=10$. Therefore, the area of one triangle is $\frac{1}{2}(4)(10)=20$. 

Since the parallelogram is made up of two congruent triangles, the area of the parallelogram is double the area of one triangle, which is $2\cdot20=\boxed{40}$.

